import 'package:rumahpetani/Models/petani.dart';

class ApiStatic {
  static Future<List<Petani>> getPetani() async {
    List<Petani> petani = [];
    for (var i = 0; i < 10; i++) {
      petani.add(Petani(
        idPenjual: i,
        nama: "Nama Petani$i",
        nik: "2255015014" + i.toString(),
        alamat: "Alamat",
        foto:
            "data:image/jpeg;base64,",
        telp: "123",
        idKelompokTani: 1,
        status: "Y",
        namaKelompok: "Himpunan Petani Desa Temukus",
        updatedAt: "",
        createdAt: "",
      ));
    }
    return petani;
  }
}
